import "./App.css";
import TodoForm from "./Components/TodoForm";
import TodoListFilter from "./Components/TodoListFilter";

function App() {
  return (
    <div className="todoapp stack-large">
      <TodoForm></TodoForm>
      <TodoListFilter></TodoListFilter>
    </div>
  );
}

export default App;
